      "title": "Consent Form",
      "content": "\u003Cmain class=\"content-horizontal-center content-vertical-center\"\u003E\n  \u003Cdiv style=\"width: 90%;\"\u003E\n    \n    \u003Ch2\u003ESUOSTUMUSLOMAKE\u003C\u002Fh2\u003E\n\n    \u003Ch3\u003ESanojen käsittelyn ja merkityksen ymmärtäminen\u003C\u002Fh3\u003E\n\n    \u003Cp class=\"text-left\"\u003ESinua pyydetään osallistumaan tutkimukseen, jonka tarkoituksena on selvittää, kuinka luet ja käsittelet sanoja ja niiden merkityksiä. Pyydämme sinua lukemaan tämän lomakkeen ja esittämään mahdollisia tutkimusta koskevia kysymyksiä ennen kuin suostut osallistumaan tähän tutkimukseen.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003ETämän tutkimuksen vastuuhenkilö on tohtori Erin M. Buchanan, joka toimii kognitiivisen analytiikan professorina Harrisburgin yliopistossa.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003ETaustatiedot:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Tässä tutkimuksessa sinua pyydetään vastaamaan sanoja koskeviin kysymyksiin. Sinua voidaan esimerkiksi pyytää määrittelemään sanan piirteitä, sen tuttuutta tai yksinkertaisesti arvioimaan onko kyseessä lainkaan oikea sana. \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EMenetelmät:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Tähän tutkimukseen osallistuminen tapahtuu täysin verkossa näppäimistöllä varustetulla pöytätietokoneella tai kannettavalla tietokoneella. Tutkimuksen osiot valitaan satunnaisesti jokaiselle vastaajalle ja saat jokaiseen osioon ohjeistuksen. Kun olet valmis, saat lisätietoa tutkimuksesta ja sen tavoitteista. Tutkimukseen osallistuminen vie keskimäärin alle 30 minuuttia. \u003C\u002Fp\u003E\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003ETutkimukseen osallistumisen haitat ja hyödyt:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Tutkimuksessa ei kerätä tietoa, jonka avulla sinut voisi tunnistaa, joten vastauksesi pitäisi olla anonyymeja. Tutkimus on luonteeltaan verkkopelin kaltainen ja voit tehtävästä riippuen kokea väsyvyyttä tai tylsistymistä.\n    \u003Cbr \u002F\u003E\n    Tutkimukseen osallistumisesta ei ole sinulle välitöntä hyötyä. Vastauksesi kuitenkin auttavat meitä ymmärtämään kieltä ja muistitoimintoja.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EKorvaukset:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003ESaatat olla paikallisen tutkijan kautta oikeutettu korvaukseen tutkimukseen osallistumisestasi. \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003ELuottamuksellisuus ja aineiston jakaminen:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Toimenpiteitä tehdään kaiken antamasi tiedon anonymisoimiseksi. Tässä tutkimusprojektissa kerätty aineisto jaetaan julkisesti muiden tutkijoiden käytettäväksi, mutta mikään osa aineistoa ei ole suoraan yhdistettävissä sinuun. Nimeäsi tai muita tunnistetietojasi ei sisällytetä aineistoon, eikä tutkimuksen suullisissa tai kirjallisissa raporteissa viitata tietoihin, jotka olisivat liitettävissä sinuun. Kaikissa julkaisuissa tutkimusta koskeva tieto annetaan muodossa, jossa sinua ei voida tunnistaa.\n    \u003Cbr \u002F\u003E\n    Kaikki potentiaalisesti tunnistamiseen vaikuttava tieto poistetaan ennen kuin aineisto jaetaan tutkimusryhmän ulkopuolelle. Tämän tutkimuksen tutkimusryhmä tai muut tutkijat voivat käyttää anonymisoitua aineistoa tähän tutkimukseen liittyviin tai muihin tutkimustarkoituksiin. Anonyymia aineistoa voidaan myös jakaa verkossa olevissa data-arkistoissa, kuten Open Science Frameworkissa (jotka ovat ilmaisia data-arkistoja jotka edellyttävät rekisteröitymistä käyttöoikeuden saamiseksi). Data-arkistojen avulla muut tutkijat tai asiasta kiinnostuneet voivat saada pääsyn aineistoon omia analyysejaan varten.\n    \u003Cbr \u002F\u003E\n    Huomioithan, että sinua koskeva data on anonymisoitua, mikä tarkoittaa, ettet voi pyytää sen poistamista tutkimukseen osallistumisen jälkeen.\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003ETutkimuksen vapaaehtoisuus:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Tutkimukseen osallistuminen on vapaaehtoista: Päätöksesi osallistua tai jättää osallistumatta tutkimukseen ei vaikuta sinun nykyiseen tai tulevaan suhteeseesi Harrisburgin yliopistoon tai paikalliseen tutkimuslaitokseesi. Jos päätät osallistua, voit jättää vastaamatta mihin tahansa kysymykseen tai vetäytyä tutkimuksesta ilman, että se vaikuttaa edellä mainittuihin suhteisiin.  \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EYhteydenotto ja kysymykset:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Tutkimusta vetää tohtori Erin. M. Buchanan yhdessä Psychological Science Acceleratorin kanssa. Voit nyt esittää mieleesi nousseita kysymyksiä. Jos sinulla tulee myöhemmin kysyttävää tutkimuksesta, sinua kannustetaan ottamaan yhteyttä tohtori Erin M. Buchananiin sähköpostiosoitteella ebuchanan@harrisburgu.edu. \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EKysymykset tai huolenaiheet:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Tämä tutkimus on käynyt läpi Harrisburgin yliopiston eettisen lautakunnan tarkastusprosessin. Eettinen lautakunta on päättänyt, että tutkimus täyttää osa- ja liittovaltion lakien sekä Yliopiston säädösten asettamat ihmiseen kohdistuvaa tutkimusta velvoittavat suojeluvaatimukset. \n\n    \u003Cp class=\"text-left\"\u003E\u003Ca href=\"https:\u002F\u002Fosf.io\u002Fgxnuz\u002Fdownload\"\u003E Pyynnöstä tästä tiedosta annetaan kopio omaan käyttöösi.\u003C\u002Fa\u003E\u003C\u002Fp\u003E\n\n    \u003C\u002Fdiv\u003E\n    \n\u003C\u002Fmain\u003E\n\n\u003Cfooter\u003E\n  Paina \u003Ckbd\u003EAvaruus\u003C\u002Fkbd\u003E suostua tutkimukseen ja jatkaa.\n\u003C\u002Ffooter\u003E"
